import React, { Component } from 'react';
import { connect } from 'react-redux';

class Feedback extends Component {
  render() {
    const { sectionPlayer } = this.props;
    const { name, score, gravatarEmail } = sectionPlayer;
    return (
      <div>
        <div>
          <h1>
            Jogador:
            <span data-testid="header-player-name">Nome do jogador</span>
          </h1>
          <img alt="avatar" src="https://www.com.br" data-testid="header-profile-picture" />
          <p data-testid="header-score">Pontuação</p>
        </div>
      </div>
    );
  }
}

const mapStateToProps = (state) => ({
  sectionPlayer: state.sectionReducer,
});

export default connect(mapStateToProps)(Feedback);
